COPY public.vacancies (id, content, department, title, inserted_at, updated_at) FROM stdin;
00000178-261d-f5a4-3d0d-36d859660000	\n TaxGig aims to ease the pain of preparing your tax returns by outsourcing it to certified tax professionals. While there are many other players in the market, we believe that our deep understanding of both taxpayers and tax professionals needs makes our product singular and appealing. However, true specialists know that even the best ideas cannot succeed and win the hearts of others without a proper marketing. In this world of noise, it is important to make your message clear and outstanding, may it be a full-scale campaign or just a Facebook post. Anything can create its impact. \n\n        \n Therefore, we are in search of such person, who will help spread the word about TaxGig and what we offer to ease the pain of tax preparation. You will be leading our Marketing campaign and work closely with founders. \n\n\n        \n ## Responsibilities: \n\n        \n Researching and identifying key marketing chains to grow our audience \n\n        \n Leading and providing strategic guidance on marketing campaign \n\n        \n Analyzing and communicating with media, target audiences and influencers \n\n        \n Overseeing and producing content before publishing \n\n        \n Developing our key messages and ensuring we stay in consistence with them and maintain the same position throughout  \n\n        \n Providing product representation when needed at public events \n\n\n        \n ## Requirements: \n\n        \n 3+ years in marketing, preferably in SaaS, with strong background in Content Marketing and Marketing Communications \n\n        \n Experience in creating marketing content across several disciplines (text, design, video, etc.) and media (blog, whitepapers, research, infographics, etc.) \n\n        \n Masters Degree in Business or Marketing \n\n        \n Ambitious, proactive, and result-oriented team player with a strategic mindset \n\n        \n An open mind with a positive attitude \n\n\n        \n ## We offer: \n\n        \n Interesting and challenging work \n\n        \n An international and multicultural working environment with experienced and enthusiastic colleagues \n\n        \n Plenty of opportunities to learn, grow and progress in your career \n\n        \n Flexible working hours \n\n        \n Paid vacations, days off and sick leaves \n\n        \n PE (Private Entrepreneur/Sole Proprietor) accounting and support \n\n        \n Corporate library, tech talks, conferences and other opportunities to broaden your knowledge \n\n        \n The ability to focus on your work: a lack of bureaucracy and micromanagement, and convenient corporate services \n\n        \n Friendly atmosphere, concern for the comfort of specialists \n\n        \n Stock option \n\n	Marketing	Marketing Director	2021-03-12 11:06:40	2021-03-12 11:06:40
00000178-261d-f687-3d0d-36d859660000	 \n TaxGig - is the first online marketplace solely dedicated to tax preparation services. As great projects require great people, we are looking for such one to join our front-end development team. \n\n\n    \n You will develop brand new features with a distributed team and should be proactive in terms of proposing new ideas. You will be working with the founders and other stakeholders in a highly collaborative manner. Together with Hong Kong engineers, you are going to develop a new solution for tax preparation services. \n\n\n    \n ## Responsibilities: \n\n    \n Collaboration with other Front-end & Back-end developers to build and ship features \n\n    \n Requirements elicitation, breaking down real-world problems into smaller pieces and technical tasks \n\n    \n Research, review and test new technology \n\n    \n Demonstrate exceptional programming skills, as well as passion in building elegant, intuitive and functional user interfaces \n\n\n\n    \n ## Required Skills and Experience: \n\n    \n Strong modern JavaScript skills (ES 6 or above) \n\n    \n Strong React skills, at least 1+ years of experience \n\n    \n Understanding of state-management patterns such as Redux \n\n    \n Feeling comfortable in working with the latest CSS & HTML standards \n\n    \n Version control systems (GIT) \n\n    \n Genuine interest to keep up to date with the latest technologies and trends \n\n\n    \n ## Highly Desirable: \n\n    \n Experience with functional programming languages \n\n    \n Experience with test driven development (TDD) \n\n    \n Build tools such as Webpack or Parcel \n\n    \n Familiarity with test frameworks (Jest, Enzyme, Mocha etc.) \n\n    \n Experience with CSS preprocessors such as SASS, PostCSS or CSS Modules \n\n    \n Knowledge of continuous integration processes (Jenkins), containers (Docker) \n\n    \n Demonstrable understanding of user experience (UX) & best practices \n\n    \n Experience with agile methodologies (preferably SCRUM) \n\n    \n Strong Computer Science fundamentals \n\n\n    \n ## Personal requirements: \n\n    \n Solid writing English (Upper Intermediate or higher) \n\n    \n Team player with good communication skills \n\n    \n Customer focused; caring about the end result, not just the technical side \n\n    \n An open mind and a positive attitude \n\n    \n Goal oriented and self-motivated with a business mindset \n\n\n    \n ## We offer: \n\n    \n Interesting and challenging work \n\n    \n An international and multicultural working environment with experienced and enthusiastic colleagues \n\n    \n Plenty of opportunities to learn, grow and progress in your career \n\n    \n Flexible working hours \n\n    \n Paid vacations, days off and sick leaves \n\n    \n PE (Private Entrepreneur/Sole Proprietor) accounting and support \n\n    \n Corporate library, tech talks, conferences and other opportunities to broaden your knowledge \n\n    \n The ability to focus on your work: a lack of bureaucracy and micromanagement, and convenient corporate services \n\n    \n Friendly atmosphere, concern for the comfort of specialists \n\n    	Development	ReactJS Developer (field - position)	2021-03-12 11:06:41	2021-03-12 11:06:41
\.
